export const Modal = (props) => {
	return (
		<div className="modal">
			<h1 className="modal_title">{props.taskName}</h1>
			<h2 className="modal_description">Description:</h2>
			<p className="modal_description-text">{props.taskDescr}</p>
			<div className="modal__status-container">
				<p>Status: </p>
				<input type="checkbox" checked={props.taskStatus} />
			</div>
			<button className="modal_close-btn" type="click">
				Close
			</button>
		</div>
	);
};
